FeedItemServicePlaceholderType:
  type: string
  nullable: true
  enum:
  - QUICKLINK
  - CALLEXTENSION
  - AD_CUSTOMIZER
  - CALLOUT
  - STRUCTURED_SNIPPET
  - UNKNOWN
  title: FeedItemServicePlaceholderType
  description: |
    <div lang="ja">FeedItemServicePlaceholderTypeは、FeedItem情報の種類を選択します。<br>
    このフィールドは、レスポンスの際に返却されますが、リクエストの際には無視されます。</div>
    <div lang="en">FeedItemServicePlaceholderType selects FeeItem information type.<br>
    Although this field will be returned in the response, it will be ignored on input.</div>
    <dl class=term>
      <dt class="term__item">QUICKLINK</dt>
      <dd class="term__desc"><span lang="ja">広告表示アセットのクイックリンクアセットです。<br>※現在、こちらのEnumは利用できません。</span><span lang="en">Quick link asset from ad display asset<br>*Currently this Enum is not available.</span></dd>
      <dt class="term__item">CALLEXTENSION</dt>
      <dd class="term__desc"><span lang="ja">広告表示アセットの電話番号アセットです。<br>※現在、こちらのEnumは利用できません。</span><span lang="en">Call asset (Phone Number) from ad display asset<br>*Currently this Enum is not available.</span></dd>
      <dt class="term__item">AD_CUSTOMIZER</dt>
      <dd class="term__desc"><span lang="ja">データ自動挿入です。</span><span lang="en">Data Auto Insertion</span></dd>
      <dt class="term__item">CALLOUT</dt>
      <dd class="term__desc"><span lang="ja">テキスト補足アセットです。<br>※現在、こちらのEnumは利用できません。</span><span lang="en">Callout asset from ad display asset<br>*Currently this Enum is not available.</span></dd>
      <dt class="term__item">STRUCTURED_SNIPPET</dt>
      <dd class="term__desc"><span lang="ja">カテゴリ補足アセットです。<br>※現在、こちらのEnumは利用できません。</span><span lang="en">Category snippet asset from ad display asset<br>*Currently this Enum is not available.</span></dd>
      <dt class="term__item">UNKNOWN</dt>
      <dd class="term__desc"><span lang="ja">未知の値です。</span><span lang="en">Unknown value.</span></dd>
    </dl>
